import "./compo.css";
import { Link } from "react-router-dom";
const Signup = () => {
  return (
    <>
      <div className="login-pop login-pop-signup">
        <h1 className="name">SignUp</h1>
        <label htmlFor="#pass">Email</label>
        <input id="pass" placeholder="Email" type="text" />
        <label htmlFor="#user">Username</label>
        <input autoFocus id="user" placeholder="username" type="text" />
        <label htmlFor="#pass">Password</label>
        <input id="pass" placeholder="password" type="text" />
        <button className="login-btn login-btn-2">Signup</button>
        <span>
          Alerady have a acoount?<Link to="/login">Login</Link>
        </span>
      </div>
    </>
  );
};

export default Signup;
